') RETURN apex_plugin.t_dynamic_action_ajax_result IS',
'    v_result apex_plugin.t_dynamic_action_ajax_result;',
'    v_json_query p_dynamic_action.attribute_01%type := p_dynamic_action.attribute_01;',
'    v_template   p_dynamic_action.attribute_02%type := p_dynamic_action.attribute_02;',
