'    v_raw_json   CLOB;',
'',
'    v_data_type_list    apex_application_global.vc_arr2;',
'',
'    v_query_output apex_plugin_util.t_column_value_list2;',
'BEGIN',
'    v_data_type_list(1) := apex_plugin_util.c_data_type_clob;',
'',
'    v_query_output := apex_plugin_util.get_data2 (',
'        p_sql_statement   => v_json_query,',
'        p_data_type_list   => v_data_type_list,',
'        p_min_columns     => 1,',
'        p_max_columns     => 1,',
'        p_max_rows        => 1,',
'        p_component_name  => ''RADPrint''',
'    );',
'    ',
'    v_raw_json := v_query_output(1).value_list(1).clob_value;',
'',
'    apex_json.open_object;',
'    apex_json.write(''data'', v_raw_json);',
'    apex_json.write(''template'', v_template);',
'    apex_json.write(''output'', v_output);',
'    apex_json.close_object;',
'',
'    RETURN v_result;',
'END;',
'',
'',
'FUNCTION load_action (',
'    p_dynamic_action IN apex_plugin.t_dynamic_action,',
'    p_plugin IN apex_plugin.t_plugin',
') RETURN apex_plugin.t_dynamic_action_render_result IS',
'    v_result apex_plugin.t_dynamic_action_render_result := apex_plugin.t_dynamic_action_render_result();',
'    v_items_to_submit p_dynamic_action.attribute_05%type := NVL(p_dynamic_action.attribute_05, ''IGNORED'');',
'',
'    v_jquery_items p_dynamic_action.attribute_05%type := '''';',
'BEGIN',
'    v_result.ajax_identifier := apex_plugin.get_ajax_identifier;',
'',
'    FOR i IN(',
'        SELECT trim(regexp_substr(v_items_to_submit, ''[^,]+'', 1, LEVEL)) l',
'        FROM dual',
'        CONNECT BY LEVEL <= regexp_count(v_items_to_submit, '','')+1',
'    )',
'    LOOP',
'        v_jquery_items := v_jquery_items || ''#'' || i.l || '','';',
'    END LOOP;',
'',
'    v_jquery_items := SUBSTR(v_jquery_items, 1, LENGTH(v_jquery_items) - 1);',
'',
'    v_result.javascript_function := ''function(event, data) {',
'    apex.server.plugin(this.action.ajaxIdentifier, {',
'        pageItems: "'' || v_jquery_items || ''" // optional',
'    }, {',
'        success: function(pData) {',
'            let parsed = JSON.parse(pData.data);',
'',
'            radprint.download(pData.template, pData.output, parsed);',
'        },',
'        error: function(jqXHR, textStatus, errorThrown) {',
'            console.error("Plugin AJAX error:", textStatus, errorThrown);',
'        }',
'    });',
'}'';',
'',
'    RETURN v_result;',
'END;',
''))
